import React,{Component} from 'react';
import './App.css';
import getUserData from './actions/index';
import { connect } from "react-redux";
import {CarItem} from './CarItem';



export class App extends Component{

constructor(props){
  super(props);
  this.state={data:[]};
}

componentDidMount(){
  this.setState({
     data:this.props.getUserData()
  });
}
render() {

     const datalist = this.state.data.map((item) => (

     <CarItem
       key={item.id}
       name={item.make}
       job={item.occupation}
       email={item.email}
       bio={item.bio}
     />


    ));
    return (
   {datalist}
    );

}

}



export default connect(null,{getUserData})(App);
